import { Slider, Switch } from 'antd';


const RangeSlider = (props) => {
    let marks = Array(props.max - props.min + 1).fill().map((_, idx) => props.min + idx)
    return(
        <Slider range defaultValue={[props.min, props.max]} marks={marks} step={1} min={props.min} max={props.max} />
    )
}

export default RangeSlider
